import "./Footer.css"

const Footer = () => {
    return ( 
        <div className="footer">
            <ul className="footer-divider">
                <li> <span className="name">Avihay Maman</span> </li>
                <li> <a href="https://github.com/AvihayM6">Github</a> </li>
                <li>Portfolio</li>
            </ul>
        </div>
     );
}

export default Footer;
